        <script>
                function loadLottieAnimations() {
                                // Load the Lottie animations here
                                var animation1 = lottie.loadAnimation({
                                container: document.getElementById('lottie-animation-1'),
                                renderer: 'svg',
                                loop: true,
                                autoplay: true,
                                path: '../tpl/images/kontakt/half-moon.json'
                                });
                                var animation2 = lottie.loadAnimation({
                                container: document.getElementById('lottie-animation-2'),
                                renderer: 'svg',
                                loop: true,
                                autoplay: true,
                                path: '../tpl/images/kontakt/rocket.json'
                                });
                                var animation3 = lottie.loadAnimation({
                                container: document.getElementById('lottie-animation-3'),
                                renderer: 'svg',
                                loop: true,
                                autoplay: false, // set autoplay to false so we can control it
                                path: '../tpl/images/kontakt/UFO.json'
                                });

                                // Define a function to play the animation3
                                function playAnimation3() {
                                animation3.play();
                                setTimeout(pauseAnimation3, animation3.totalFrames / animation3.frameRate * 1000); // wait for the animation to finish playing
                                }

                                // Define a function to pause the animation3
                                function pauseAnimation3() {
                                animation3.pause();
                                setTimeout(playAnimation3, 15000); // wait for 15 seconds before starting the animation again
                                }

                                // Wait for 10 seconds before playing the third animation once
                                setTimeout(function() {
                                animation3.play();
                                setTimeout(pauseAnimation3, animation3.totalFrames / animation3.frameRate * 1000); // wait for the animation to finish playing
                                }, 10000);

                        }

                        document.addEventListener('DOMContentLoaded', function() {
                                if (typeof lottie !== 'undefined') {
                                loadLottieAnimations();
                                console.log('It is loaded');
                                } else {
                                console.error('Lottie library is not loaded');
                                }
                        });
        </script>
